import cardimg1 from "./asset/respiratory rate.svg";
import cardimg2 from "./asset/temperature.svg";
import cardimg3 from "./asset/HeartBPM.svg";

const carddet = [
    {
      id:1,
      iconname:cardimg1,
      name:'Respiratory Rate',
      value:'20 bpm',
      subname:'Normal',
      cardbg:"#E0F3FA",
    },
    {
        id:2,
        iconname:cardimg2,
        name:'Temperature',
        value:'98.6 F bpm',
        subname:'Normal',
        cardbg:"#FFE6E9",
      },
      {
        id:3,
        iconname:cardimg3,
        name:'Heart Rate',
        value:'78 bpm',
        subname:'Lower than Average',
        cardbg
      }
      
]
export default carddet;
